import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { DispDishService } from '../disp-dishes/disp-dish.service';

@Component({
  selector: 'app-add-dish',
  templateUrl: './add-dish.component.html',
  styleUrls: ['./add-dish.component.css'],
  providers: [DispDishService]
})
export class AddDishComponent {
  dishForm: FormGroup;

  constructor(private formBuilder: FormBuilder, private service: DispDishService) {
    this.dishForm = this.formBuilder.group({
      dishName: ['', Validators.required],
      dishDescription: ['', Validators.required],
      dishPrice: ['', Validators.required],
      dishImage: ['', Validators.required],
      nature: ['', Validators.required],
      dishCategory: ['', Validators.required]
    });
  }


  onSubmit() {

    const urlPath = new URL(window.location.href).pathname;
    const categoryId = parseInt(urlPath.split("/")[2])
    console.log(categoryId);
    // if (this.dishForm.valid) {
    //   this.service.addDish(,this.dishForm.value)
    // }
    console.log(this.dishForm.value);
  }
}
